import React from "react";

export default class ListWidgetComponent extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            elements: false,
        }
    }

    componentDidMount() {
        const { requestUrl } = this.props;
        const url = 'http://localhost:5000' + requestUrl;
        console.log(url);
        this.setState({
            elements: true
        });
        fetch(url)
            .then(res => res.json())
            .then(result => this.setState({
                elements: result
            }));
    }

    _renderListItems() {
        const { elements } = this.state;
        let list = [];
        elements.map(element => {
            let lines = [];
            for (const [key, value] of Object.entries(element)) {
                lines.push(
                    <span>{key}: {value}</span>
                )
            }

        });

        return list;
    }

    render() {
        if (this.state.elements === false) {
            return(
                <span>Loading elements</span>
            );
        } else {
            return(
                <span>
                    {this.state.elements}
                </span>
            );
        }
    }
};
